import React, { useState } from 'react';
import axios from 'axios';

function LoanForm() {
  const [formData, setFormData] = useState({
    // Add all your form fields here
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: 0,
    Previous_Salary: 0,
    Owns_House: '',
    Rent_Amount: 0,
    Grocery_Expense: 0,
    Current_EMIs: 0,
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: 0,
    Number_of_Credit_Cards: 0,
    Total_Credit_Limit: 0,
    Number_of_Loans: 0,
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: 0,
    Savings: 0,
    Investments: 0,
    Monthly_Expenses: 0,
    Age: 0,
    Education_Level: '',
    Marital_Status: '',
    Dependents: 0,
    Loan_Purpose: '',
    Requested_Loan_Amount: 0,
    Preferred_Repayment_Period: 0,
    Mall_Visits_Per_Month: 0,
    Mall_Spend_Average: 0
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/predict', formData);
      console.log(response.data);
      // Handle the response data
    } catch (error) {
      console.error("There was an error!", error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Create form fields with name attributes matching formData keys */}
      <input type="text" name="Full_Name" value={formData.Full_Name} onChange={handleChange} />
      {/* Add other form fields here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default LoanForm;
